import { Container, Row, Col ,ListGroup, ListGroupItem} from "react-bootstrap";
import './message.css';
function Message() {
    return (
        <Container className="messageContainer">
            <ListGroup>
                <ListGroupItem>Jaysing</ListGroupItem>
                <ListGroupItem></ListGroupItem>
                <ListGroupItem></ListGroupItem>
            </ListGroup>
        </Container>
    );
}

export default Message;
